import defaultAddresses from '../../models/address';

const initialState = defaultAddresses;

export default function addressReducer(state = initialState, action) {
    console.log('see state ',state);
    switch (action.type) {
      case 'db/addressAdded': {
        let { address } = action.payload;
        return state.concat(address);
      }
      default:
        return state;
    }
}
